css:
@-moz-document
	url-prefix('http://www.tumblr.com/'),
	url-prefix('https://www.tumblr.com/')
{
  #new_post {
    background: url(data:image/jpeg;base64,)
      rgb(253,254,214) center no-repeat !important;
  }
  /*.new_post_label_icon {background-image: none !important}*/
.new_post_label > I {display: none}
  .new_post_label:hover {
/*    top: -4px !important;*/
    padding: 57px 0 22px 1px !important;
    color: black !important;
    font-weight: bold !important;
    font-size: large !important;
  }
  .new_post_label {
    transition: /*top*/padding 0.4s, font-size 0.4s, font-weight 0.4s;
  }
}
